import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

export default function DownloadRoute({match}) {
    const [name, setName] = useState<null | string>(null);

    useEffect(() => {
        const getData = async () => {
            await fetch("/file/info/" + match.params.id)
        }

        getData();
    }, []);

    if(name == null) {
        return <div className="bg-gray-900 min-h-screen flex flex-col justify-center">
            <div className="bg-gray-700 px-10 py-10 mx-auto text-center rounded">
                <h3 className="text-2xl text-gray-400 mb-10 font-light">Download File</h3>

                <button className="text-white text-lg bg-gray-500 px-6 py-3 mt-8 rounded">Name <FontAwesomeIcon icon="download" className="ml-4"/> </button>
            </div>
        </div>;
    }

    return <div className="bg-gray-900 min-h-screen flex flex-col justify-center">
            <div className="bg-gray-700 px-10 py-10 mx-auto text-center rounded">
                <h3 className="text-2xl text-gray-400 mb-10 font-light">Download File</h3>

                <button className="text-white text-lg bg-gray-500 px-6 py-3 mt-8 rounded">{name} <FontAwesomeIcon icon="download" className="ml-4"/> </button>
            </div>
        </div>;
}
